import React, { useState } from 'react';

function Todo() {
  const [todos, setTodos] = useState([
    { id: Date.now(), text: 'Learn React', isEditing: false },
    // Initial todos...
  ]);

  const addTodo = () => {
    setTodos([...todos, { id: Date.now(), text: '', isEditing: false }]);
  };

  const deleteTodo = (id) => {
    setTodos(todos.filter(todo => todo.id!== id));
  };

  return (
    <div>
      <input
        value={input}
        onChange={(e) => setInput(e.target.value)}
        placeholder="Add a todo"
      />
      <button onClick={addTodo}>Add</button>
      <ul>
        {todos.map((todo) => (
          <li key={todo.id}>
            {todo.isEditing? (
              <input
                type="text"
                value={todo.editText || ''}
                onChange={(e) =>
                  setTodos(todos.map(item => item.id === todo.id? {...item, editText: e.target.value} : item))
                }
                onBlur={() => setTodos(todos.map(item => item.id === todo.id? {...item, isEditing: false, text: item.editText} : item))}
                autoFocus
              />
            ) : (
              <>
                {todo.text}
                <button onClick={() => setTodos(todos.map(item => item.id === todo.id? {...item, isEditing: true} : item))}>Edit</button>
                <button onClick={() => deleteTodo(todo.id)}>Delete</button>
              </>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Todo;
